import {Wrapper, Title, ProgramContainer} from './HomePage.styles'

type HomePageProps = {}

const HomePage: React.FC<HomePageProps> = () => (
  <Layout>
    <Header />
    <FilterMenu />
    <ProgramContainer>
        <h2>300 Engineering degrees found!</h2>
    </ProgramContainer>
    <BottomBar/>
  </Layout>
);



export default HomePage;
